}

subscription_protocol.html.body:
Subscription ProtocolSubcription protocol is currently available only on the Java server.IntroductionBy default a Signal K server will provide a new WebSocket client with a delta stream of the vessels.self record, as updates are received from sources. E.g.
/signalk/v1/stream will provide the following delta stream, every time the log value changes .{
  "context": "vessels",
   "updates": [{
      "source": {
        "pgn": "128275",
        "device": "/dev/actisense",
        "timestamp": "2014-08-15-16:00:05.538",
        "src": "115"
      },
      "values": [
        {
          "path": "navigation.logTrip",
          "value": 43374
        },
        {
          "path": "navigation.log",
          "value": 17404540
        }]
     }
     ]
}
Below we refer to WebSockets, but the same process works in the same way over any transport. E.g. for a raw TCP
connection the connection causes the above message to be sent, and sending the subscribe messages will have the same
effect as described here.This can be a lot of messages, many you may not need, especially if vessel.self has many sensors, or other data sources. Generally you will want to subscribe to a much smaller range of data.First you will want to unsubscribe from the current default (or you may have already connected with ws://hostname/signalk/v1/stream?subscribe=none). To unsubscribe all create an unsubscribe message with wildcards and send the message over the websocket connection:{
  "context": "*",
  "unsubscribe": [
    {
      "path": "*"
    }
  ]
}
To subscribe to the required criteria send a suitable subscribe message:{
  "context": "vessels.self",
  "subscribe": [
    {
      "path": "navigation.speedThroughWater",
      "period": 1000,
      "format": "delta",
      "policy": "ideal",
      "minPeriod": 200
    },
    {
      "path": "navigation.logTrip",
      "period": 10000
    }
  ]
}
path=[path.to.key] is appended to the context to specify subsets of the context.
The path value can use the wildcard *. A wildcard in the middle of a path (propulsion/*/oilTemperature) allows any value for that part and a wildcard at the end (propulsion/port/*) matches all paths beginning with the specified prefix.

The following are optional, included above only for example as it uses defaults anyway:period=[millisecs] becomes the transmission rate, e.g. every period/1000 seconds. Default=1000

format=[delta|full] specifies delta or full format. Default: delta

policy=[instant|ideal|fixed]. Default: idealinstant means send all changes as fast as they are received, but no faster than minPeriod. With this policy the client has an immediate copy of the current state of the server.

ideal means use instant policy, but if no changes are received before period, then resend the last known
values.eg send changes asap, but send the value every period millisecs anyway, whether changed or not.

fixed means simply send the last known values every period.


minPeriod=[millisecs] becomes the fastest message transmission rate allowed, e.g. every minPeriod/1000 seconds. This is only relevant for policy='instant' to avoid swamping the client or network.
You can subscribe to multiple data keys multiple times, from multiple apps or devices. Each app or device simply subscribes to the data it requires, and the server and/or client implementation may combine subscriptions to avoid duplication as it prefers on a per connection basis. At the same time it is good practice to open the minimum connections necessary, for instance one websocket connection shared bewteen an instrument panel with many gauges, rather then one websocket connection per gauge.When data is required once only, or upon request the subscribe/unsubscribe method should not be used. If the client is http capable the REST api is a good choice, or use get/list/put messages over websockets or tcp.The get/list/put messages work in the same way as their GET/PUT REST equivalents, returning a json result for the requested path.Use Cases and Proposed SolutionsLocal boat individual instrumentsA gauge-type display for just one or a few data items for the 'self' vessel should be able to specify that it only wants
those items for the self vessel.This can be achieved by a default WebSocket connection /signalk/v1/stream?subcribe=none, then sending a JSON message:{
  "context": "vessels.self",
  "subscribe": [
    {
      "path": "environment.depth.belowTransducer"
    },
    {
      "path": "navigation.speedThroughWater"
    }
  ]
}
The JSON format is also viable over a simple TCP or serial transport, and is therefore supported as the primary
subscription method.Map display with all known vessel positions & directions, served over 3G cellular connection{
  "context": "vessels.*",
  "subscribe": [
    {
      "path": "navigation.position",
      "period": 120000,
      "policy": "fixed"
    },
    {
      "path": "navigation.courseOverGround",
      "period": 120000,
      "policy": "fixed"
    }
  ]
}
The result is a delta message of the Signal K data with just position and courseOverGround branches for all known vessels, sent every 2 minutes (120 seconds) even if no data has been updated.Position of a certain vessel, immediately it changes, but once per minute at most{
  "context": "vessels.230029970",
  "subscribe": [
    {
      "path": "navigation.position",
      "minPeriod": 60000,
      "policy": "instant"
    }
  ]
}
The result will be delta position messages for vessel 230029970, broadcast whenever it changes, but with minimum
interval of 60 seconds. Messages are delayed to meet the minimum interval with newer messages overriding the previous
message in the buffer.

notifications.html.body:
Alarm, Alert, and Notification HandlingHandling alarms, alerts, and notifications in Signal K is a multi-stage process. Alarms, alerts and notifications are
all handled the same way, and are all referred to as alarms below.We need a flexible model to define alarm conditions, and a standard way to announce and record them.Alarm ProcessDefine alarm states as zones in the meta object attached to any Signal K value. See [[Metadata for Data Values]]

If the value is within an alarm zone raise the defined alarm.

If the value goes out of the zone, remove the alarm by setting its value to null

Alarms are raised by placing an alarm object in the vessels.self.notifications tree

Expected implementation behaviourThe server (or device) should monitor the current value and compare it to the defined zones.

If a value enters an alarm zone, then a key is written to vessels.self.notifications..

If a value leaves an alarm zone, then the key is removed from vessels.self.notifications..

Alarms raised are monitored by an alarm process on the server, which takes appropriate action, sounding alarms, or
displaying messages.

Clients interested in alarms can subcribe to the vessels.self.notifications... tree in the usual way and be informed
of alarms in the same way as normal signalk keys.

When an alarms is removed, a delta should be sent to subscribers with the path and a null value.

Exampleeg If we exceed our anchor alarm radius: vessels.self.navigation.anchor.currentRadius enters
vessels.self.navigation.anchor.currentRadius.meta.zones[[50,500, "alarm", "Dragging anchor!"]],The alarm is : vessels.self.notifications.navigation.anchor.currentRadiusThe alarm object is{
  "method": ["sound"],
  "state": "alarm",
  "message": "Dragging anchor!",
  "timestamp": ..,
  "source": {..}
}
The server alarm manager will see this new entry and turn on the alarm. Using a manager process allows flexibility in
situations where multiple alarms are triggered and your vessel is a mass of flashing and beeping. eg A single 'Pause'
button can give you 5-10 minutes to take action, stopping annoying noise, and removing popup messages from screens.Since the vessels.self.notifications tree mirrors the other data in the signal k model, we can selectively watch or
react to specific branches or keys. When displaying multiple alarms a screen can also sort and filter them.Other AlarmsAbove we have discussed monitoring existing values and raising alarms. There are other alarms that must be considered,
eg MOB, fire, sinking etc, and misc alerts "GPS signal lost".etc.The vessels.[uuid].notifications tree is the same as any other Signal k branch. Keys can be added and removed as
required in the usual way. Since the branch is being monitored we only need to add a key of any sort to create a
suitable alarm.In the case of an emergency, create a unique key: The alarm is : vessels.[uuid].notifications.[alarm.key]The alarm object is{
